import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 28, height: 28, viewBox: "0 0 28 28", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M4.08 4.1a1 1 0 011.42 0l8.5 8.5 8.5-8.5a1 1 0 111.42 1.42l-8.5 8.5 8.46 8.46a1 1 0 11-1.41 1.42L14 15.43 5.53 23.9a1 1 0 01-1.41-1.42l8.47-8.46-8.5-8.5a1 1 0 010-1.42z", fill: primaryFill }));
};
const Dismiss28Filled = wrapIcon(rawSvg({}), 'Dismiss28Filled');
export default Dismiss28Filled;
